import React, { Component } from 'react';
import {fetchTripData} from '../firebase/firebase.utils'
import Progress from '../progress/Progress';

export default class PastTrip extends Component {
  state = {
    tripList: [],
    userID: '',
  };

  componentDidMount(){
    if(this.props.currentUser) {
        const { trips, id } = this.props.currentUser;
    let tripsData = []

    if (trips.length > 0){
        trips.map(async el=> {
            try {
                let item = await fetchTripData(el)
                tripsData.push(item)
              } catch (err) {
                console.log(err);
              }
        })
    }
    console.log(tripsData, tripsData.date)
    }
  }

  render() {



    return this.props.currentUser ? (<div>Hellos</div>) : <Progress />
  }
}
